window.bookSummaryJSON = "<p><b>The riveting new novel from the #1 <i>New York Times</i> bestselling author of <i>The Liar</i>.</b> </p> <p>Naomi Bowes lost her innocence the night she followed her father into the woods. In freeing the girl trapped in the root cellar, Naomi revealed the horrible extent of her father's crimes and made him infamous. </p> <p>Now a successful photographer living under the name Naomi Carson, she has found a place that calls to her, thousands of miles away from everything she's ever known. Naomi wants to embrace the solitude, but the residents of Sunrise Cove keep forcing her to open up - especially the determined Xander Keaton. </p> <p>Naomi can feel her defenses failing, and knows that the connection her new life offers is something she's always secretly craved. But as she's learned time and again, her past is never more than a nightmare away. </p>"; 
